      .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    var zoom = d3.behavior.zoom()
      .on("zoom", draw);

    var gradient = svg.append("defs").append("linearGradient")
      .attr("id", "gradient")
      .attr("x2", "0%")
      .attr("y2", "100%");

    gradient.append("stop")
      .attr("offset", "0%")
      .attr("stop-color", "#fff")
      .attr("stop-opacity", .5);

    gradient.append("stop")
      .attr("offset", "100%")
      .attr("stop-color", "#999")
      .attr("stop-opacity", 1);

    svg.append("clipPath")
      .attr("id", "clip")
      .append("rect")
      .attr("x", x(0))
      .attr("y", y(1))
      .attr("width", x(1) - x(0))
      .attr("height", y(0) - y(1));

    svg.append("g")
      .attr("class", "y axis")
      .attr("transform", "translate(" + width + ",0)");

    svg.append("path")
      .attr("class", "area")
      .attr("clip-path", "url(#clip)")
      .style("fill", "url(#gradient)");

    svg.append("g")
      .attr("class", "x axis")
      .attr("transform", "translate(0," + height + ")");

    svg.append("path")
      .attr("class", "line")
      .attr("clip-path", "url(#clip)");

    svg.append("rect")
      .attr("class", "pane")
      .attr("width", width)
      .attr("height", height)
      .call(zoom);


    //d3.csv("readme-flights.csv", function(error, data) {
    data.forEach(function (d) {
      d.date = parseDate(d.date);
      d.value = +d.value;
    });

    x.domain([new Date(1988, 0, 1), new Date(2003, 0, 0)]); //change this to a variable portion of dataset, and to current date
    y.domain([0, d3.max(data, function (d) { return d.value; })]);
    zoom.x(x);
    zoom.y(y);

    svg.select("path.area").data([data]);
    svg.select("path.line").data([data]);

    svg.selectAll("circle")
      .data(data)
      .enter().append("circle")
      .attr("r", 5)
      .style("fill", "none")
      .style("stroke", "none")
      .style("pointer-events", "all")
      .append("title")
      .text(function (d) { return "Date: " + formatDate2(d.date) + " Value: " + d.value; });

    draw();

    //});

    function draw() {
      svg.select("g.x.axis").call(xAxis);
      svg.select("g.y.axis").call(yAxis);
      svg.select("path.area").attr("d", area);
      svg.select("path.line").attr("d", line);
      svg.selectAll("circle")
        .attr("cx", function (d) { return x(d.date); })
        .attr("cy", function (d) { return y(d.value); });
    }
  </script>
</body>

</html>
